import react from "react"
import CartItemList from "./CartItemsList";

function Cart({ cartArr }){
  return(
    <div>
      <h1>Cart</h1>
       {cartArr.map(item=> <CartItemList item={item} />)}
    </div>

  )
}

export default Cart;
